  [],\n\t\"num_tags\": 0,\n\t\"name\": \"temperature-salinity-and-nutrients-data-from-ctd-and-bottle-casts-from-a-world-wide-distributio\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"CTD and bottle data were collected from
  the ANDROMEDA and other platforms from a world-wide distribution from 01 January
  1923 to 31 December 1999. Data were primarily collected off the coast of Portugal.
  Data include profiles of pH, temperature and salinity. Bottle data include concentration
  profiles of oxygen, phosphate, total phosphate, silicate, nitrate, nitrite, ammonia,
  chlorophyll, and phaeophytin. Data are archived in the International Council for
  the Exploration of the Sea (ICES) Oceanographic format. Additional funding for digitizing
  historic data were provided by the Global Ocean Data Archaeology and Rescue (GODAR)
  project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
